export default function SavingsResult(props){
    return(
        <tr>
        <td>{props.data['year']}</td>
        <td>{props.data['savingsEndOfYear']}</td>
        <td>INTEREST GAINED IN YEAR{props.data['yearlyInterest']}</td>
        <td>TOTAL INTEREST GAINED{props.data['yearlyInterest']*props.data['year']}</td>
        <td>TOTAL INVESTED CAPITAL{props.data['yearlyContribution']*props.data['year']}</td>
      </tr>
    )
}
